import logo from "../Assets/Logo_trans.png";
import PropTypes from "prop-types";

function Header({text}){
    return <header className="header-content">
        <img src={logo} alt="Logo" />
        <br/>
        <h2>{text}</h2>
    </header>
}

Header.propTypes = {
    text: PropTypes.string
}

export default Header;
